import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-loguin',
  templateUrl: './loguin.page.html',
  styleUrls: ['./loguin.page.scss'],
})
export class LoguinPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>loguin</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-content>
    <div id="header">
      <div id="app-bar">
        <ion-icon name="arrow-back" routerLink="/welcome"></ion-icon>
        <div id="logo">
          <img src="assets/icon/moio.png" alt="">
        </div>
      </div>
    </div>
  </ion-content>
</ion-content>
